import React, { useState, useEffect } from 'react';
import { View, Text, Button, TextInput, ScrollView, StyleSheet, TouchableOpacity } from 'react-native';
import { supabase } from '../lib/supabase';

export default function Info() {
    const [questions, setQuestions] = useState([]);
    const [selectedOption, setSelectedOption] = useState(null);
    const [selectedQuestionIndex, setSelectedQuestionIndex] = useState(null);
    const [answer, setAnswer] = useState('');
    const [buttonColor, setButtonColor] = useState({ oui: 'white', non: 'white', idk: 'white' });

    useEffect(() => {
        fetchQuestions();
    }, []);

    async function fetchQuestions() {
        try {
            const { data, error } = await supabase.from('questionnaire_dons_questions').select(`
            libelleQuestion, 
            questionnaire_dons_details_questions(idQuestion, libelleDetailQuestion)
          `);

            if (error) {
                console.error('erreur ', error);
                return;
            }

            setQuestions(data);
        } catch (error) {
            console.error(error);
        }
    }

    function handleOptionSelect(option, index) {
        setSelectedOption(option);
        setSelectedQuestionIndex(index);
        setButtonColor(prevState => ({
            oui: option === 'Oui' ? 'green' : 'white',
            non: option === 'Non' ? 'green' : 'white',
            idk: option === 'Je ne sais pas' ? 'green' : 'white'
        }));
    }

    return (
        <ScrollView>
            {questions.map((question, index) => (
                <View key={index}>
                    <Text>{question.libelleQuestion}</Text>
                    {selectedQuestionIndex === index && selectedOption === 'Oui' && question.questionnaire_dons_details_questions.map((detail, detailIndex) => (
                        <View key={detailIndex}>
                            <Text>{detail.libelleDetailQuestion}</Text>
                            <TextInput
                                placeholder="Réponse"
                                onChangeText={(text) => setAnswer(text)}
                                value={answer}
                            />
                        </View>
                    ))}
                   <View style={styles.buttonContainer}>
                        <TouchableOpacity style={styles.buttonOui} onPress={() => handleOptionSelect('Oui', index)}>
                            <Text style={styles.buttonText}>Oui</Text>
                        </TouchableOpacity>
                        <TouchableOpacity style={styles.buttonIDK} onPress={() => handleOptionSelect('Je ne sais pas', index)}>
                            <Text style={styles.buttonTextIDK}>Je ne sais pas</Text>
                        </TouchableOpacity>
                        <TouchableOpacity style={styles.buttonNon} onPress={() => handleOptionSelect('Non', index)}>
                            <Text style={styles.buttonText}>Non</Text>
                        </TouchableOpacity>                    
                    </View>
                </View>
            ))}
        </ScrollView>
    );
}

const styles = StyleSheet.create({
    buttonContainer: {
        flexDirection: 'row',
        justifyContent: 'space-around',
        marginTop: 10,
    },
    buttonIDK: {
        backgroundColor: 'white',
        padding: 10,
        borderRadius: 5,
        width: '40%', // Modifiez la largeur selon vos besoins
        borderColor : 'black',
        borderWidth : 1
    },
    buttonOui: {
        backgroundColor: 'white',
        padding: 10,
        borderRadius: 5,
        width: '25%', // Modifiez la largeur selon vos besoins
        borderColor : 'black',
        borderWidth : 1
    },
    buttonNon: {
        backgroundColor: 'white',
        padding: 10,
        borderRadius: 5,
        width: '25%', // Modifiez la largeur selon vos besoins
        borderColor : 'black',
        borderWidth : 1
    },
    buttonText: {
        color: 'black',
        textAlign: 'center',
        
    },
    buttonTextIDK: {
        color: 'black',
        textAlign: 'center',
        
    },
});
